.canvas-color-picker-item.canvas-color-p.value:
conic-gradient(
    var(--color-red),
    var(--color-yellow),
    var(--color-green),
    var(--color-blue),
    var(--color-purple),
    var(--color-red)
  )

.markdown-preview-view hr.value:
linear-gradient(
      to left,
      transparent,
      var(--text-accent) 45%,
      transparent 45%,
      transparent 55%,
      var(--text-accent) 5%,
      transparent
    )
    3

.hr.cm-line hr.value:
linear-gradient(
      to left,
      transparent,
      var(--text-accent) 45%,
      transparent 45%,
      transparent 55%,
      var(--text-accent) 5%,
      transparent
    )
    3
